import React from "react";
import LogoutButton from "./LogoutButton";
import apiClient from "./apiClient";

const HelloPage = async (props) => {
    const user = await apiClient.get("/api/v1/user/info");
    return (<>
            <h1>Начало курсачу положено, {user.data.firstName}!</h1>
            <LogoutButton/>
        </>
    )
}

export default HelloPage
